            <h2 class=""section_title section_about_title"">О Компании ТрансТелеКом</h2>
            <p class=""section_about_text"">Компания ТрансТелеКом – один из ведущих российских операторов связи. Основной акционер ТТК – ОАО «РЖД», владеет 99,99% акций Компании. Компания является одним из основных поставщиков магистральных услуг связи для операторов и крупнейших корпораций России, а также входит в число лидеров среди провайдеров услуг широкополосного доступа в Интернет, телевидения и телефонии для конечных пользователей в регионах.<br> Компания активно вовлечена в процессы цифровой трансформации ОАО «РЖД» и транспортно-логистической сферы в целом. ТТК традиционно оказывает холдингу «РЖД» услуги предоставления связи и высокоскоростных корпоративных сетей, развивает и обеспечивает эксплуатацию инфраструктуры систем связи и транспортной безопасности. Компания развивает новые компетенции в интересах холдинга «РЖД");
